The Gamo Whisper .177 Air Rifle is sure to keep your firepower protected from the elements. This Gamo whisper pellet gun features a non-removable noise dampener that reduces noise up to 52%.

Gamo Air Gun Air Repeater, Whisper .177 cal, Break Barrel:•MECHANISM: Velocity: 1200 feet per second (fps) with PBA, 1000 fps with Lead - Single Shot - Break Barrel: Single Cocking System, Spring piston - Automatic Cocking Safety system
 •STOCK: Tough All Weather molded Synthetic - Ventilated rubber pad for recoil absorption - Thin cheekpad molded on each side for both Right hand and Left hand shooters - Non-Slip texture design on grip and forearm; 
•SIGHTS: Fiber optic front sight with sight guard - Fiber optic adjustable rear sight; 
•OPTICS: Raised Rail - 3-9x40mm standard reticule air rifle scope with one piece solid mount; 
•SPECIFICATIONS Weight: 5.28 lbs - Length: 46.0" - Ammunition: Any .177 Pellet - Caliber: .177 - Trigger Pull: 3.74 lbs - Cocking effort:30 lbs - Barrel Length: 18 in

Many extras included. Must be an adult to purchase
